import React, { useState, useEffect, useMemo } from 'react';
import './HomePage.css'; 

const HomePage = () => {
  const products = useMemo(() => [
    {
      id: 1,
      name: 'Product 1',
      description: 'Description of Product 1',
      image: 'data:image/jpeg;base64,',
    },
    {
      id: 2,
      name: 'Product 2',
      description: 'Description of Product 2',
      image: 'data:image/jpeg;base64,', 
    },
    {
      id: 3,
      name: 'Product 3',
      description: 'Description of Product 3',
      image: 'data:image/jpeg;base64,', 
    },
    {
      id: 4,
      name: 'Product 4',
      description: 'Description of Product 4',
      image: 'data:image/jpeg;base64,', 
    },
    {
      id: 5,
      name: 'Product 5',
      description: 'Description of Product 5',
      image: 'data:image/jpeg;base64,', 
    },
    {
      id: 6,
      name: 'Product 6',
      description: 'Description of Product 6',
      image: 'data:image/jpeg;base64,', 
    },
    {
      id: 7,
      name: 'Product 7',
      description: 'Description of Product 7',
      image: 'data:image/jpeg;base64,', 
    },
    {
      id: 8,
      name: 'Product 8',
      description: 'Description of Product 8',
      image: 'data:image/jpeg;base64,', 
    },
    {
      id: 9,
      name: 'Product 9',
      description: 'Description of Product 9',
      image: 'data:image/jpeg;base64,', 
    },

    {
      id: 10,
      name: 'Product 10',
      description: 'Description of Product 10',
      image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTJfsPNkNOgqBpHj64MJDKEkG-i18OodkIi9A&usqp=CAU', 
    },
    {
      id: 11,
      name: 'Product 11',
      description: 'Description of Product 11',
      image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTHeMjITgVXEoJIAQV0_fKgLOsyyJRdct_PTg&usqp=CAU', 
    },
    {
      id: 12,
      name: 'Product 12',
      description: 'Description of Product 12',
      image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQlc6caW8GAVfSk9Fc-8gjmv6HhpoX20E2yIw&usqp=CAU', 
    },
    {
      id: 13,
      name: 'Product 13',
      description: 'Description of Product 13',
      image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRxkO-5pAgtCTN4eq2BH4CyG_IW9CACujB5YkSm_NysYWFAQ6Xc6-NysWMhTDyrQjNLnFU&usqp=CAU', 
    },
    {
      id: 14,
      name: 'Product 14',
      description: 'Description of Product 14',
      image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTcX2BwtNyYs3ZXBPDMZCPxXiHqO83tUy6Mug&usqp=CAU', 
    },
    {
      id: 15,
      name: 'Product 21',
      description: 'Description of Product 15',
      image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRn957ShYHxZabSzgBz7ZYoxmtJ4Yj-wjS0EPYYHBQveh3Q8f8w-0FpneN0i2QXjtsjT7g&usqp=CAU', 
    },
  ], []);

  const [searchTerm, setSearchTerm] = useState('');
  const [searchResults, setSearchResults] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [productsPerPage] = useState(5); 

  useEffect(() => {
    setSearchResults(products);
  }, [products]);

  const handleChange = (event) => {
    setSearchTerm(event.target.value);
    filterProducts(event.target.value);
  };

  const filterProducts = (searchTerm) => {
    const filteredProducts = products.filter(
      (product) =>
        product.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
        product.id.toString().includes(searchTerm)
    );
    setSearchResults(filteredProducts);
    setCurrentPage(1); 
  };

  const indexOfLastProduct = currentPage * productsPerPage;
  const indexOfFirstProduct = indexOfLastProduct - productsPerPage;
  const currentProducts = searchResults.slice(indexOfFirstProduct, indexOfLastProduct);

  const paginate = (pageNumber) => setCurrentPage(pageNumber);

  return (
    <div className="container">
      <h1>Welcome to the Home Page!</h1>
      <input
        type="text"
        placeholder="Search by name or ID"
        value={searchTerm}
        onChange={handleChange}
      />
      <table>
        <thead>
          <tr >
            <th>ID</th>
            <th>Name</th>
            <th>Description</th>
            <th>Image</th>
          </tr>
        </thead>
        <tbody>
          {currentProducts.map((product) => (
            <tr key={product.id} >
              <td>{product.id}</td>
              <td>{product.name}</td>
              <td>{product.description}</td>
              <td>
                <img src={product.image} alt={product.name} style={{ maxWidth: '100px', maxHeight: '100px' }} />
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <div className="pagination">
        <button onClick={() => paginate(currentPage - 1)} disabled={currentPage === 1}>{"<"}</button>
        {[...Array(Math.ceil(searchResults.length / productsPerPage)).keys()].map((number) => (
          <button key={number + 1} onClick={() => paginate(number + 1)} className={currentPage === number + 1 ? "active" : ""}>
            {number + 1}
          </button>
        ))}
        <button onClick={() => paginate(currentPage + 1)} disabled={currentPage === Math.ceil(searchResults.length / productsPerPage)}>{">"}</button>
      </div>
    </div>
  );
};

export default HomePage;
